import Link from 'next/link'
const NavBar=()=>(
<div>
    <ul>
    <li>
        <Link href="/">Home</Link>
    </li>
    <li>
        <Link href="/about">About</Link>
    </li>
</ul>

<style jsx>
    {`
    ul{
        background: #333;
        color: #fff;
        list-style:none;
        dislay: flex;
    }
    ul li{
        font-size:18px;
        margin-right:20px;
    }`}
</style>
</div>
)
export default NavBar
